selector_to_html = {"a[href=\"#created-modified-section\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Created &amp; Modified Section<a class=\"headerlink\" href=\"#created-modified-section\" title=\"Link to this heading\">#</a></h2><p>The <strong>Created &amp; Modified</strong> section contains the following:</p>", "a[href=\"#profile-screen-mailing-address\"]": "<figure class=\"align-center\" id=\"profile-screen-mailing-address\">\n<a class=\"reference internal image-reference\" href=\"../../_images/mailing-address-zoomed-in.jpeg\"><img alt=\"../../_images/mailing-address-zoomed-in.jpeg\" src=\"../../_images/mailing-address-zoomed-in.jpeg\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Profile Screen, Mailing Address</span><a class=\"headerlink\" href=\"#profile-screen-mailing-address\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#upload-logo-section\"]": "<figure class=\"align-center\" id=\"upload-logo-section\">\n<a class=\"reference internal image-reference\" href=\"../../_images/upload-logo.jpeg\"><img alt=\"../../_images/upload-logo.jpeg\" src=\"../../_images/upload-logo.jpeg\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Profile Screen, Upload Logo Section</span><a class=\"headerlink\" href=\"#upload-logo-section\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#mailing-address\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Mailing Address<a class=\"headerlink\" href=\"#mailing-address\" title=\"Link to this heading\">#</a></h2><p>The <strong>Mailing Address</strong> section is where you can change the mailing address of your company (if different from the primary address).</p>", "a[href=\"#activity-log-section\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Activity Log Section<a class=\"headerlink\" href=\"#activity-log-section\" title=\"Link to this heading\">#</a></h2><p>The <strong>Activity Logs</strong> section contains a list of changes made to the company\u2019s profile.</p><p>Each <strong>Activity Log entry</strong> contains the following:</p>", "a[href=\"#profile-screen-info\"]": "<figure class=\"align-center\" id=\"profile-screen-info\">\n<a class=\"reference internal image-reference\" href=\"../../_images/info-zoomed-in.jpeg\"><img alt=\"../../_images/info-zoomed-in.jpeg\" src=\"../../_images/info-zoomed-in.jpeg\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Profile Screen, Name and Contact Information</span><a class=\"headerlink\" href=\"#profile-screen-info\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../../_images/created-modified-activity-log.jpg\"><img alt=\"../../_images/created-modified-activity-log.jpg\" src=\"../../_images/created-modified-activity-log.jpg\" style=\"width: 50%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Information Pane</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#upload-logo\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Upload Logo<a class=\"headerlink\" href=\"#upload-logo\" title=\"Link to this heading\">#</a></h2><p><strong>To Upload:</strong></p>", "a[href=\"#profile-screen-information-section\"]": "<figure class=\"align-center\" id=\"profile-screen-information-section\">\n<a class=\"reference internal image-reference\" href=\"../../_images/main-screen.jpeg\"><img alt=\"../../_images/main-screen.jpeg\" src=\"../../_images/main-screen.jpeg\" style=\"width: 50%;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Profile Screen, Information Section</span><a class=\"headerlink\" href=\"#profile-screen-information-section\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#editing-company-information\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Editing Company Information<a class=\"headerlink\" href=\"#editing-company-information\" title=\"Link to this heading\">#</a></h1><p>The <strong>Profile</strong> screen allows you edit the following information about your company:</p>", "a[href=\"#file-explorer-filename-png\"]": "<figure class=\"align-center\" id=\"file-explorer-filename-png\">\n<a class=\"reference internal image-reference\" href=\"../../_images/file-explorer-filename-png.jpeg\"><img alt=\"../../_images/file-explorer-filename-png.jpeg\" src=\"../../_images/file-explorer-filename-png.jpeg\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">File Explorer, File Name Selected</span><a class=\"headerlink\" href=\"#file-explorer-filename-png\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#name-and-contact-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Name and Contact Information<a class=\"headerlink\" href=\"#name-and-contact-information\" title=\"Link to this heading\">#</a></h2><p>The <strong>Info</strong> section of the <strong>Profile</strong> screen allows you to edit various details about your company.</p>", "a[href=\"#information-pane\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Information Pane<a class=\"headerlink\" href=\"#information-pane\" title=\"Link to this heading\">#</a></h1><p>The <strong>Information Pane</strong> (Right Column) provides both an <strong>Activity Log</strong> and a <strong>Created &amp; Modified</strong> Section.</p>", "a[href=\"#profile-screen-primary-address\"]": "<figure class=\"align-center\" id=\"profile-screen-primary-address\">\n<a class=\"reference internal image-reference\" href=\"../../_images/primary-address-zoomed-in.jpeg\"><img alt=\"../../_images/primary-address-zoomed-in.jpeg\" src=\"../../_images/primary-address-zoomed-in.jpeg\" style=\"width: 400px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Profile Screen, Primary Address</span><a class=\"headerlink\" href=\"#profile-screen-primary-address\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#primary-address\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Primary Address<a class=\"headerlink\" href=\"#primary-address\" title=\"Link to this heading\">#</a></h2><p>The <strong>Primary Address</strong> section is where you can change the primary location of your company.</p>", "a[href=\"#file-explorer-open\"]": "<img src='/en/stable-edit/_static/solo_app/Universal/file-explorer-open.jpeg' alt='File Explorer Open' style='width:200px;'>", "a[href=\"#upload-logo-button\"]": "<img src='/en/stable-edit/_static/solo_app/Profile/upload-logo-section/upload-logo-button.jpeg' alt='Upload Logo Button' style='width:200px;'>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
